val parquetFileClick = sqlContext.read.parquet("/home/ama/sidana/calypso_data_feb_march/calypso_data_feb_march/click/fr/2016/*/*")
val clicks = parquetFileClick.filter(!($"offerViewId".isNull))
val clicksTime = clicks.where(to_date($"utcDate") > to_date(lit("2016-01-31")))
