    val parquetFileClickDay = clicksTime.where(to_date($"utcDate") === date)
    val ratings_positive_day = parquetFileClickDay.groupBy("userId","offerViewId").count


    val parquetFileOffer = sqlContext.read.parquet("/home/ama/sidana/calypso_data_feb_march/calypso_data_feb_march/offerView/fr/2016/*/*")

    //val parquetFileOfferDay = sqlContext.read.parquet("/home/ama/sidana/calypso_data_feb_march/calypso_data_feb_march/offerView/fr/"+year+"/"+year+month+"/"+year+month+day)
    val parquetFileOfferDay = parquetFileOffer.where(to_date($"utcDate") === date)
